import React from 'react'
import './ProductSearch.css'

function ProductSearch(props) {
    return (
        <div className="productContainer d-flex align-items-center w-100 justify-content-end">
        <p className="productSearchName">{props.productName}</p>
        <span>in {props.category}</span>
        </div>
    )
}

export default ProductSearch
